using Cfmg.Cafe.Manager.Domain.DomainModels;
using Cfmg.Cafe.Manager.Infrastructure;

namespace Cfmg.Cafe.Manager.Application.DataSeed
{
    public static class CafeManagerDataSeed
    {
        public static void InsertData(CafeManagerDbContext dbContext)
        {
            var cafeIds = new[]
                {
                    Guid.NewGuid(),
                    Guid.NewGuid(),
                    Guid.NewGuid()
                };

            if (!dbContext.Cafe.Any())
            {

                var cafes = new List<CafeEntity>
                {
                    new(cafeIds[0], "The Coffee Spot", "A cozy coffee shop in the city center", "", "City Center"),
                    new(cafeIds[1], "Brew & Bean", "A trendy cafe serving the best espresso in town", "", "Downtown"),
                    new (cafeIds[2], "Latte Love", "A cafe with a focus on artisan coffee blends", "", "Suburban Area")
                };

                dbContext.Cafe.AddRange(cafes);
            }

            if (!dbContext.Employee.Any())
            {
                var employees = new List<EmployeeEntity>
                {
                    new ("UIE000001", "Alice Johnson", "alice.johnson@example.com", "93456890", "Female", DateTime.Now.AddDays(-45), cafeIds[0]),
                    new ("UIE000002", "Bob Smith", "bob.smith@example.com", "88568901", "Male", null, null),
                    new ("UIE000003", "Charlie Brown", "charlie.brown@example.com", "94569012", "Male", null, null)
                };

                dbContext.Employee.AddRange(employees);
            }

            dbContext.SaveChanges();
        }
    }
}
